(17, 'Famosa por sus hojas gruesas en forma de corazón, es una suculenta trepadora de crecimiento lento.', 'Hoya', 'Semanal', 'Baja', 'Alta', 'Hoya', 'Hoya spp', 0.5, 'Compacto', 'Alta', 'No toxica'),
